import { createBrowserRouter, createRoutesFromElements, NavLink, Route, RouterProvider, Routes } from 'react-router-dom'
import Home from '../Pages/Home';
import SlideRecord from '../Pages/SlideRecord';
import SpeedSlalomRecord from '../Pages/SpeedSlalomRecord';
import AthleteInfo from '../Pages/AthleteInfo';

const Navbar = () => {
  return (
    <div>
      <div className="Navbar">
        <input type="checkbox" id="navcheck" role="button" title="menu" />
        <label htmlFor="navcheck" aria-hidden="true" title="menu">
          <span className="burger">
            <span className="bar">
              <span className="visuallyhidden">Menu</span>
            </span>
          </span>
        </label>
        {/* <nav id="menu"> */}
        <nav className='menu'>
          <NavLink to="/Home">Home</NavLink>
          <NavLink to={SpeedSlalomRecord} id="speedslalom" onClick={SpeedSlalomRecord}>Speed Slalom</NavLink>
          <NavLink to="/Pages/SlideRecord" id="slide">Slide</NavLink>
          <NavLink to="/Pages/ClassicSlalomRecord" id="slide">Classic</NavLink>
          <NavLink to="/Pages/AthleteInfo" id="slide">AthleteInfo</NavLink>
        </nav>
      </div>
      <div>
      </div>
    </div>

  );
};

export default Navbar;
